import React from 'react';
import styled from 'styled-components';
import SmoothCorners from '../components/common/SmoothCorner';

const useSetPosition = position => {};

const CirclesContainer = styled.div`
  width: 1.6rem;
  height: 1.6rem;
  position: relative;
`;

const Circle = styled.span`
  position: absolute;
  top: ${props => (props.top ? props.top : 'initial')};
  bottom: ${props => (props.bottom ? props.bottom : 'initial')};
  left: ${props => (props.left ? props.left : 'initial')};
  right: ${props => (props.right ? props.right : 'initial')};
  width: 6px;
  height: 6px;
  border: 2px solid var(--ui-04);
  border-radius: 50%;
`;

const NavButton = () => {
  return (
    <SmoothCorners>
      <CirclesContainer>
        <Circle top="0" left="0" />
        <Circle top="0" right="0" />
        <Circle bottom="0" left="0" />
        <Circle bottom="0" right="0" />
      </CirclesContainer>
    </SmoothCorners>
  );
};

export default NavButton;
